import React, { Component } from 'react'; 
import PlayfulPalette2 from './assets/playfulpalette2.jpg';
import PlayfulPalette from './assets/playfulpalette.jpg';

import SyriaCover from './assets/syriacover.jpg';

class HomeGrid extends Component {

    render() {
        return (
          <div>
            <div class="container">
              <div class="row">
                <div class="col">
                  <img src={PlayfulPalette} alt="Playful Palette thumbnail" class="cropped"></img>
                </div>
                <div class="col">
                    <img src={SyriaCover} alt="Syria Cover thumbnail" class="cropped"></img>
                </div>
                <div class="col">
                    <iframe title="vimeo-player" src="https://player.vimeo.com/video/230313693" width="640" height="333" frameborder="0" allowfullscreen></iframe>
                </div>
              </div>
             </div>
          </div>
        ) 
    }
}
export default HomeGrid;
